import React from "react";
import HighlightIcon from '@material-ui/icons/Highlight';

function Header() {
  return (
    <header>
      <h1>  <HighlightIcon /> Keeper</h1>
      <i className="bi bi-box-arrow-right header_icon"></i>
    </header>
  );
}

export default Header;
